import React from 'react';
import './App.css';
import Header from "./components/Header";
import Giphy from "./components/Giphy";
import {BrowserRouter} from "react-router-dom";


function App() {

  return (
      <BrowserRouter>
           <div className="App">
               <Header/>
               <Giphy/>
           </div>
      </BrowserRouter>
  );
}
export default App;
